import React from "react";
import "./App.css";
import Navbar from "./Navbar";

import Footer from "./Footer";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function App() {
  return (
    <div className="app">
      <Router>
        <Navbar />
        <Switch>
          <Route path="/">
            <Home />
          </Route>
          <Route path="/Login">
            <Login />
          </Route>
          <Route path="/MYBOOKING">
            <Mybooking />
          </Route>
          <Route path="/Contact">
            <Footer />
          </Route>
        </Switch>
      </Router>
    </div>
  );
}

export default App;
